            function search(prevShape, color,clarity,lab,cut,polish,symmetry,fluorescence,eyeclean,minp,maxp,page) {
                 data = {};
                if(minp) {
                    data.minp = minp;
                }
                if(maxp) {
                    data.maxp = maxp;
                }
                if(prevShape) {
                    data.prevShape = prevShape;
                }
                if(color) {
                    data.color = color;
                }
                if(clarity) {
                    data.clarity= clarity;
                }
                if(lab) {
                    data.lab= lab;
                }
                if(cut) {
                    data.cut= cut;
                }
                if(polish) {
                    data.polish= polish;
                }
                if(symmetry) {
                    data.symmetry = symmetry;
                }
                if(fluorescence){
                    data.fluorescence = fluorescence;
                }
                if(eyeclean){
                data.eyeclean = eyeclean;
                }
                $.ajax({
                headers: {
                    'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
                },
                url: ENDPOINT + "/fetch_diamond?page=" + page,
                datatype: "html",
                type: "post",
                data: data,
                beforeSend: function () {
                    $('.auto-load').show();
                }
            })
            .done(function (response) {
                if(response){
                    $('.auto-load').hide();
                    var data = JSON.parse(response);
                    console.log(data);
